package org.santihs.examples.set;import java.util.ArrayList;import java.util.HashSet;import java.util.Set;public class HashSetSourceDuplicate {    public static void main(String[] args) {        String[] originalArrayList2 = {"sardina", "lenguado", "pejerrey", "dorado", "atun", "lenguado", "atun"};        Set<String> duplicates = new HashSet<>();        ArrayList<String> originalArrayList = new ArrayList<>();        Set<String> uniques = new HashSet<>(originalArrayList);        uniques.removeAll(duplicates);        System.out.println("elements uniques: " + uniques);        System.out.println("elements duplicates: " + duplicates);    }}